// src/components/ActivityList.js
import React from 'react';

const ActivityList = ({ activities, onViewActivity }) => {
    return (
        <ul>
            {activities.map((activity, index) => (
                <li key={index}>
                    {activity.name} - Streak: {activity.streak}
                    <button onClick={() => onViewActivity(index)}>View</button>
                    {/* Add other buttons and functionality as needed */}
                </li>
            ))}
        </ul>
    );
};

export default ActivityList;
